import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import CardData from './CardInfo';

//console.log(CardData[1]);

function nCard(value){
  return (
    <>
      src={value.mySrc}
      link={value.mySrc}
      category={value.mySrc}
      title={value.mySrc}
    </>
  );
}

ReactDOM.render(
  <>
    <Card
      newCarData = {CardData.map(nCard)} 
    />
  </>,document.getElementById('root')
);
